public ActionForward perform_select_action(ActionMapping mapping, ActionForm form, HttpServletRequest request, HttpServletResponse response) {
  HttpSession session = request.getSession(true);
  ActionForward actionForward = null;
  com.egen.util.jdbc.JdbcUtil j = null;
  try {
    j = new com.egen.util.jdbc.JdbcUtil();
    GeracaoRomaneioActionForm f = (GeracaoRomaneioActionForm) form;
    select_action(j, mapping, form, request, response);
    actionForward = new ActionForward("/com/GeracaoRomaneio_rGrid.do?select_action=",true);
  } catch (Exception e) {
    ActionErrors errors = new ActionErrors();
    errors.add("ActionErrors.GLOBAL_ERROR_bl_form_Jw_geracao_romaneio", new ActionMessage("error.action.exception",com.egen.util.system.Error.getMessage(e)));
    request.setAttribute(org.apache.struts.Globals.ERROR_KEY, errors);
    session.setAttribute("exception", com.egen.util.system.Error.getDescription(e));
    actionForward = mapping.findForward("same");
  } finally {
    if (j != null) {
      j.close();
    }
  }
  return actionForward;
}

private void select_action(JdbcUtil j, ActionMapping mapping, ActionForm form, HttpServletRequest request, HttpServletResponse response) throws Exception {
  HttpSession session = request.getSession(true);
  GeracaoRomaneioActionForm f = (GeracaoRomaneioActionForm) form;
  acesso.Usuario usuario = (acesso.Usuario)session.getAttribute("User");
  if(usuario.mostraQuery()){
     throw new Exception("Query não disponível! Javaview utilizada: Jw_geracao_romaneio");
  }
  if(f.getNfs_nmro().equals("") && (f.getData_inicial().equals("") || f.getData_final().equals(""))){
     throw new Exception("Um dos campos com  deve ser informado!");
  }
  Jw_geracao_romaneio table = new Jw_geracao_romaneio();
  String[][] select = null;
  String[] order = null;
  String[] groupby = null;
  String[] having = null;
  Object[][] where = { {"rep_cdgo","like", f.getRep_cdgo()},
                       {"cli_cdgo","=", com.egen.util.text.FormatNumber.toInteger(f.getCli_cdgo())}, 
                       {"esc_seqn","=", com.egen.util.text.FormatNumber.toInteger(f.getEsc_seqn())},
                       {"nfs_dtemis",">=", com.egen.util.text.FormatDate.parseTimestamp(f.getData_inicial(), "dd/MM/yyyy")},
                       {"nfs_dtemis","<=", com.egen.util.text.FormatDate.parseTimestamp(f.getData_final(), "dd/MM/yyyy")},
                       {"nfs_nmro","=", com.egen.util.text.FormatNumber.toInteger(f.getNfs_nmro())},
                       {"nfs_serie","like", f.getSerie()},
                       {"fil_filial","like", f.getFil_filial()}
                       };
  String preco_final_liquido = f.getPreco_final_liquido();
  session.setAttribute("where", where);
  session.setAttribute("preco_final_liquido", preco_final_liquido);
  session.setAttribute("mapping.getName()", form);
}
